The '''Gourmet impling''' is an [[Impling]] that can be caught in the [[Impetuous Impulses]] [[minigame]], and are located throughout [[Puro-Puro]] and [[Gielinor]]. It is caught with either a [[Butterfly net|normal]] or [[magic butterfly net]] equipped and an empty [[Impling jar]] in the player's inventory with 28 [[Hunter]], or 38 Hunter barehanded. Capturing a Gourmet impling will grant the player 22 (if caught on Puro-Puro) or 24 (if caught on Gielinor) Hunter experience.

When the gourmet impling is finally caught, the player can either free it from the [[Gourmet impling jar]], which will leave an item behind, or trade it to [[Elnock Inquisitor]] for special items. The player can either get 3 [[Impling jar]]s for one Gourmet impling or, with 3 [[Baby impling]]s and 2 [[Young impling]], can get a can of [[Imp repellent]], or alternatively can trade 3 Gourmet implings with 2 [[Earth impling]]s and an [[Essence impling]] to receive a magic butterfly net.

